UPDATE quest_template SET Details='Lord Fordragon has led a crushing assault against Arthas at the Wrathgate. In response to this affront, Arthas has sent Naxxramas down upon us. While Kel\'Thuzad hides in the floating citadel, his ground commander, Thel\'zan, lays siege to Wintergarde Keep. The lower village is already lost and any chance of extracting survivors from the ruins diminishes by the minute.$B$BWe must act quickly! Report to Gryphon Commander Urik at the gryphon station at once! He\'ll get you up to speed.$B$BLeave me!

