UPDATE npc_text SET text0_1='The Temple of the Moon is home to the priests of Elune.  There you will find Jandria and Lariia, who will provide you with further guidance in the path of priesthood.',text1_0='The power of Elune compels you!  The power of Elune compels you!  $B$BGo now!  Seek out Jandria in the central hall of the Temple of the Moon in the southern section of Darnassus!',text1_1='The power of Elune compels you!  The power of Elune compels you!  $B$BGo now!  Seek out Jandria in the central hall of the Temple of the Moon in the southern section of Darnassus!' WHERE ID=3025;
UPDATE npc_text SET text0_0='Alegorn is a masterful chef who has had centuries with which to perfect his cooking.  You should consider yourself blessed should he decide to teach you.  If you believe you are worthy, you can find him in the Craftsmen\'s Terrace.',text0_1='Alegorn is a masterful chef who has had centuries with which to perfect his cooking.  You should consider yourself blessed should he decide to teach you.  If you believe you are worthy, you can find him in the Craftsmen\'s Terrace.',text1_0='The dishes that Alegorn whips up are to die for.  He\'s always busy preparing new delicacies over in the Craftsman\'s Terrace.  Be sure to try his Cenarion Green recipe if he has any left.  $B$BNow, if you don\'t mind, I must investigate this rash of missing deer. ',text1_1='The dishes that Alegorn whips up are to die for.  He\'s always busy preparing new delicacies over in the Craftsman\'s Terrace.  Be sure to try his Cenarion Green recipe if he has any left.  $B$BNow, if you don\'t mind, I must investigate this rash of missing deer. ' WHERE ID=3036;
UPDATE npc_text SET text1_0='We plant the vegetables.  Our vegetables are eaten by the rabbit.  The rabbit is devoured by the wolf.  The wolf is slain by us.  We take the meat and hide from the wolf\'s corpse.  It\'s that Magic Circle of life, or whatever you call it.  $B$BNow go see Telonis in the Cenarion Enclave to get started and let me return to my duties.',text1_1='We plant the vegetables.  Our vegetables are eaten by the rabbit.  The rabbit is devoured by the wolf.  The wolf is slain by us.  We take the meat and hide from the wolf\'s corpse.  It\'s that Magic Circle of life, or whatever you call it.  $B$BNow go see Telonis in the Cenarion Enclave to get started and let me return to my duties.' WHERE ID=3040;
UPDATE npc_text SET prob0=1.0,text0_1='You would certainly be looking for Me\'Lynn if you have any hope of learning to be a tailor.  She resides at the Craftsmen\'s Terrace in northeastern Darnassus.',prob1=1.0,text1_1='With the garments that Me\'Lynn tailors, one might think that her needle was blessed by Elune herself.  Unless your needle is so blessed, you best pay her a visit and listen to her teachings.  You can find her in The Craftsmen\'s Terrace in northeastern Darnassus.' WHERE ID=3044;
UPDATE npc_text SET text0_1='Ah, $r... I possess great knowledge a\' da world and how ta create charms a\' great power. ' WHERE ID=3375;
UPDATE npc_text SET text1_0='I received the majority of my weapons training from Ilyenia Moonfire in the Warrior\'s Terrace.  You would do well to seek her out if you desire to learn the use of a new weapon.  ',text1_1='I received the majority of my weapons training from Ilyenia Moonfire in the Warrior\'s Terrace.  You would do well to seek her out if you desire to learn the use of a new weapon.  ' WHERE ID=4517;
