UPDATE npc_text SET text0_0='You seek the hunters?  You will find them on the second level of the Trader\'s Tier, in the Hall of the Hunt.' WHERE ID=9544;
UPDATE npc_text SET text0_0='You can find Arthaid, our stable master, outside of the Caregiver Center. He is located on the upper level of the central hub, near the Exodar\'s main entrance.' WHERE ID=9558;
UPDATE npc_text SET text0_0='Something plagues this tower. I\'ve fallen ill and the other Venture Co. employees that work near or in the tower have also become sick.$B$BJust last week, two of our patrollers died, only to instantly come back to life as mindless drones!$B$BThe lifeforce is draining from my body. I can feel myself losing control. Urges taking over... Bad urges... *Fizzule slaps himself in the face* Not yet... Listen... Mine is a position of power. This position privies me to some sensitive information. ' WHERE ID=1132;
UPDATE npc_text SET text0_0='The tinkerer\'s craft for you is it?  No doubt ye\'ll want to go see Springspindle Fizzlegear in Tinker Town.  $B$BJust head east from the gates of Ironforge, or follow the sound of the explosions.',text0_1='The tinkerer\'s craft for you is it?  No doubt ye\'ll want to go see Springspindle Fizzlegear in Tinker Town.  $B$BJust head east from the gates of Ironforge, or follow the sound of the explosions.',em0_0=0,em0_1=1,text1_0='Oh, you\'re looking for Springspindle Fizzlegear then.  Why that little gnome and his gadgets...  Let me tell you, if you\'re going to his shop in Tinker Town, keep your hands to yourself and don\'t pet any of his mechanical sheep!  $B$BExploding sheep... now why would you even make such a thing!?',text1_1='Oh, you\'re looking for Springspindle Fizzlegear then.  Why that little gnome and his gadgets...  Let me tell you, if you\'re going to his shop in Tinker Town, keep your hands to yourself and don\'t pet any of his mechanical sheep!  $B$BExploding sheep... now why would you even make such a thing!?' WHERE ID=2798;
