UPDATE npc_text SET text0_0='Do we have Mining trainers here?  Where do ye think ye are!?  $B$BWhy you\'ll find one o\' the best miners in all Dun Morogh at the Deepmountain Mining Guild on the northern side of The Great Forge.  There, Geofram Bouldertoe will show ye the true art of mining.',text0_1='Do we have Mining trainers here?  Where do ye think ye are!?  $B$BWhy you\'ll find one o\' the best miners in all Dun Morogh at the Deepmountain Mining Guild on the northern side of The Great Forge.  There, Geofram Bouldertoe will show ye the true art of mining.',em0_0=0,em0_1=5,em0_3=1 WHERE ID=2804;
