UPDATE npc_text SET text0_0='Your next choice awaits.$B$BYou alone have defeated a terrible beast that has been ravaging the countryside, taking its ear as a trophy.  You later learn that your liege had offered a reward for the beast\'s death, and that a kind but destitute knight who you know is trying to support a family by meager means claims the beast\'s kill as his own.  You have no real need for money yourself, but you know that the destitute knight is lying for his own personal gain.$B$BMake your choice.$B$B',em0_0=0,em0_1=1 WHERE ID=7363;
UPDATE npc_text SET text0_0='You can\'t teach an old dog new tricks.  At least that\'s what someone once told me.  Lucky for you, I\'ve discovered it to be untrue.$b$bNow then, would you like your pet to unlearn talents?',text0_1='You can\'t teach an old dog new tricks.  At least that\'s what someone once told me.  Lucky for you, I\'ve discovered it to be untrue.$b$bNow then, would you like your pet to unlearn talents?' WHERE ID=7722;
