UPDATE npc_text SET prob0=1.0,text0_0='You will stage a series of events that will lead the Kil\'sorrow orcs of Kil\'sorrow Fortress to believe that the Warmaul ogres have attacked their base and then another series of events to make the Warmaul ogres believe the Kil\'sorrow orcs are attacking their base.$B$BDo this and you solve both of our problems.$B$BThe Boulderfist will have their territory back and your people will be free from attack from Boulderfist, Warmaul and Shadow Council.',text0_1='' WHERE ID=9369;
UPDATE npc_text SET text0_1='\"Born from light\" would be a close translation for Sha\'tar.  It is the name we gave to the naaru who reclaimed Shattrath City from the agents of Illidan.' WHERE ID=9458;
UPDATE npc_text SET text0_1='Shattrath is more than a staging ground for war against the Burning Legion and Illidan.  It serves as a sanctuary to those seeking to escape the violence surrounding us.$B$BWe would be hypocrites if we turned the refugees away.$B$BIf your question refers to the Scryers, then I will respond that while I may not like them or their leader\'s wild claims of visions of redemption, it is not for us to question the wisdom of the naaru.$B$BThese are difficult times, $N.  We need allies where we can find them.',em0_0=0,em0_1=1 WHERE ID=9459;
