UPDATE npc_text SET text0_1='Pet families come in one of three types. Ferocious pets, like cats, can dish out damage but can\'t take it as well. Tenacious pets, like turtles, are more defensive and can occupy an enemy\'s attention while you stay at range. Cunning pets, like spiders, have a mix of offensive and defensive abilities and are particularly useful in Battlegrounds and Arenas.$b$bAs your pet gains more experience, it can learn new talents just like you can, but at a slower rate. If you ever want to change your pet\'s talents, just come back to me.' WHERE ID=13474;
