UPDATE npc_text SET text0_0='It is integral to the assimilation of this data that it is understood that the Creators wanted to synthesize a race that would long be an integral part of this world\'s development cycle after they had departed.  This race would be instrumental in fulfilling the Creators\' long-term development objectives for Azeroth.  $B$BAs an ancillary note, the nomenclature \"Earthen\" was deemed apropos for the new race by the Creators, based on the Earthen\'s composition.' WHERE ID=1085;
UPDATE npc_text SET text0_0='There are two potential results when the Earthen\'s synthesis matrix destabilizes.  Initiating visual aid representation number one.$B$BThe first variant matrix is a degenerative product of synthesis, hereby designated with the common nomenclature of \"Trogg\".  This variant maintains strength and stamina comparable to the Earthen, but its cognitive processing power has been almost completely compromised.  Force of will and a strong sense of cunning are the only driving factors in the psyche of the trogg.' WHERE ID=1088;
UPDATE npc_text SET text0_0='Initiating visual aid representation number two.$B$BThe second resultant variance of the Earthen matrix retains many desired elements when compared to the standard subterranean matrix.  The common nomenclature for this variant is \"Dwarf\".$B$BThis variant retains strength and stamina inherent to the Earthen.  In some cases, the dwarf even exceeds the cognitive powers of the Earthen\'s matrix.  The dwarf, however, retains none of the physical composition of Azeroth\'s various stone core compounds.' WHERE ID=1090;
UPDATE npc_text SET em0_0=0,em0_1=1 WHERE ID=4873;
UPDATE npc_text SET text0_0='Remember, all things are connected. If the beasts were gone from the land, our kind would die from a great loneliness of spirit, for whatever happens to the beasts also happens to the Tauren. Whatever befalls Azeroth befalls all those that inhabit it. $B',em0_0=0,em0_1=2 WHERE ID=4889;
UPDATE npc_text SET prob0=1.0,text0_0='As a mage, you are one of a select group that can conjure a portal to transport you back to this very place.  I can teach you if you are ready.' WHERE ID=5880;
