UPDATE npc_text SET text0_0='In the time before time, what the usurpers would later call the First Age of Creation, my master and his siblings ruled over this world. It was they, the Old Gods, who created all.$B$BAnd it was they who would ultimately be cast down by those that would call themselves Shapers.$B' WHERE ID=6843;
UPDATE npc_text SET text0_0='Their manifest forms weak from eons of battle, imprisoned beneath the world - the world that they themselves created - the corruption of the Titan Shapers would permeate through the surface and befoul the Old Gods.$B$BIt was then and there that the brothers did turn. For five millennia a battle was fought at the core of this world.$B' WHERE ID=6844;
UPDATE npc_text SET text0_0='It was during the Elemental Sundering that the Firelord, Ragnaros, would seek to consume my Lord, Thunderaan, Prince of Air.$B$B<Demitrian bows his head, his face contorted in rage.>$B$BSpeak his name and I shall decorate this ravaged camp with your entrails. Be silent and listen.$B' WHERE ID=6867;
UPDATE npc_text SET text0_0='What little remained of Thunderaan\'s essence was stored within a talisman of elemental binding. Ragnaros then shattered the talisman in two flawless pieces. The pieces assigned to his Lieutenants...$B' WHERE ID=6870;
UPDATE npc_text SET em0_0=0,em0_1=1 WHERE ID=8191;
UPDATE npc_text SET text0_0='To honor your elders is to honor your culture and your people, $c.  For this, the Coins of Ancestry serve as a tangible means to recognize those who choose to follow a venerable path of respect.$B$BDuring this Lunar Festival, you may have the opportunity to honor many elders.  As you do so, you will acquire the Coins of Ancestry.  Bring me these coins, and I will reward your diligence with a selection of unique items.$B' WHERE ID=8202;
