UPDATE npc_text SET prob0=100.0,text0_0='The Exodar\'s vaults are vast and well-protected. Your goods will come to no harm here.',prob1=100.0,text1_0='We control access to the Exodar\'s storage facilities. Are there goods you wish to store or remove?' WHERE ID=9567;
