UPDATE npc_text SET prob0=1.0,text0_0='If you haven\'t already, make sure that you offer your assistance to Rina Moonspring.',text0_1='' WHERE ID=10246;
UPDATE npc_text SET prob0=1.0,text0_0='As a relative newcomer to Ogri\'la, you don\'t have enough exposure to the crystals here to reap their full benefits.  Besides, you only have one head.$B$BWe, on the other hand, have been here a very long time.  So, as you can imagine, we\'re fairly well-versed in a great many things.$B$BOf late, we\'ve taken a keen interest in the demons of the forge camps.  More specifically, we\'ve devised a way to rid us of them for good.$B$BAt least, that\'s the theory.',text0_1='' WHERE ID=10919;
UPDATE npc_text SET prob0=1.0,em0_0=0,em0_1=1,em0_2=0,em0_3=1 WHERE ID=10920;
UPDATE npc_text SET prob0=1.0,text0_0='You don\'t. You\'re not strong enough to participate in ranking matches yet. Still, you can find an Arena Battlemaster and get in some practice rounds. It\'s never too soon to start training.' WHERE ID=10929;
UPDATE npc_text SET text0_0='You stand before a master of the Arcane. One would be unwise to challenge me. Many corpses have been left ablaze in my wake.' WHERE ID=13573;
UPDATE npc_text SET text0_0='Greetings, $c.$B$BThe Horde currently control Wintergrasp Fortress, but the next battle starts soon.   Get ready to head to Wintergrasp and support our forces!$B$BThe next battle begins in $4354k.',text0_1='Greetings, $c.$B$BThe Horde currently control Wintergrasp Fortress, but the next battle starts soon.   Get ready to head to Wintergrasp and support our forces!$B$BThe next battle begins in $4354k.' WHERE ID=14790;
UPDATE npc_text SET prob0=1.0,text0_1='Do you need something, $c?  Perhaps I can assist you.' WHERE ID=8858;
UPDATE npc_text SET text0_1='No, don\'t feel bad.  I get that a lot.$B$B<Taela looks both amused and annoyed.>$B$BI\'m a HIGH elf, not a blood elf.  Don\'t worry, I\'m not going to suck all of the magic out of you.' WHERE ID=9484;
UPDATE npc_text SET prob0=1.0,text0_0='I have just the thing you need to cast your spell.',text0_1='' WHERE ID=9647;
UPDATE npc_text SET text0_0='Forgive me $c, but I must concentrate on my job.',text0_1='Forgive me $c, but I must concentrate on my job.' WHERE ID=12244;
UPDATE npc_text SET text0_0='Welcome, champions! All of our attempts at bringing her down have failed. We could use a hand in bringing her down with these harpoon guns.',text0_1='Welcome, champions! All of our attempts at bringing her down have failed. We could use a hand in bringing her down with these harpoon guns.' WHERE ID=14317;
UPDATE npc_text SET text0_0='Gnomeregan\'s finest have come to compete in the tournament. Wish us luck!',text0_1='' WHERE ID=14398;
UPDATE npc_text SET text0_0='We of Darnassus look forward to competing in the tournament.' WHERE ID=14399;
UPDATE npc_text SET text0_0='Speak with Scott the Merciful, $c. He can set you on the path.$b$bDemonstrate your loyalty and their methods shall be made known to you.' WHERE ID=15160;
UPDATE npc_text SET text0_0='Brzzzzt!$B$BWelcome to Matrix Punchograph 3005 stroke C, a security level chi terminal.$B$BYou must posses a blue punch card to access terminal functions.$B$B01010010 01100101 01100011 01101001 01110000 01100101 00111010 00100000 01001101 01100101 01100011 01101000 01100001 01101110 01101001 01100011 01100001 01101100 00100000 01000011 01101000 01101001 01100011 01101011 01100101 01101110 00100000 01010011 01101111 01110101 01110000' WHERE ID=1649;
UPDATE npc_text SET text0_0='Brzzzzt!$B$BWelcome to Matrix Punchograph 3005 stroke D, a security level delta terminal.$B$BYou must posses a red punch card to access terminal functions.$B$B01010011 01101000 01101111 01110010 01110100 00100000 01100001 01101110 01100100 00100000 01110011 01110111 01100101 01100101 01110100' WHERE ID=1651;
UPDATE npc_text SET text0_1='Thank the light you are here! I\'d accept help from a two-headed ogre at this point.$B$BThe city has been overrun by troggs! The attempts to wipe them out resulted in mass contamination. But there is still hope.$B$BOur scientists who evacuated to Ironforge are working on a cure for the fallout sickness. Meanwhile, if you can help me stop the trogg invasion, perhaps the city can be retaken. ' WHERE ID=1693;
