UPDATE creature_template SET dmg_multiplier = 7.5 WHERE rank = 1 AND unit_class != 0;
UPDATE creature_template SET dmg_multiplier = 7.5 WHERE rank = 2 AND unit_class != 0;
UPDATE creature_template SET dmg_multiplier = 35 WHERE rank = 3 AND unit_class != 0;
UPDATE creature_template a1, creature_template a2 SET a1.dmg_multiplier=13 WHERE a1.entry=a2.difficulty_entry_1 and a1.rank = 1 AND a1.unit_class != 0;
UPDATE creature_template a1, creature_template a2 SET a1.dmg_multiplier=13 WHERE a1.entry=a2.difficulty_entry_1 and a1.rank = 2 AND a1.unit_class != 0;
