UPDATE creature_template AS a1
JOIN creature_template AS a2 ON a1.entry=a2.difficulty_entry_1
JOIN creature AS a3 ON a3.id=a2.entry
SET a1.dmg_multiplier = 5.9
WHERE a3.map IN (558,557,556,555,552,553,554,540,542,543,585,545,546,547,560,269)
AND a1.rank != 3
AND a1.unit_class != 0;

UPDATE creature_template AS ct
INNER JOIN creature AS c 
ON ct.entry = c.id
SET ct.dmg_multiplier = 4.6 
WHERE ct.entry = c.id 
AND c.map in (558,557,556,555,552,553,554,540,542,543,585,545,546,547,560,269)
AND ct.rank != 3
AND ct.unit_class != 0;

UPDATE creature_template AS ct
INNER JOIN creature AS c 
ON ct.entry = c.id
SET ct.dmg_multiplier = 1.7 
WHERE ct.entry = c.id 
AND c.map in (0, 1, 530)
AND ct.maxlevel <= 25
AND ct.rank IN (1, 2)
AND ct.unit_class != 0;

UPDATE creature_template AS ct
INNER JOIN creature AS c 
ON ct.entry = c.id
SET ct.dmg_multiplier = 2.4 
WHERE ct.entry = c.id 
AND c.map in (0, 1, 609)
AND ct.minlevel >= 25
AND ct.maxlevel <= 60
AND ct.rank IN (1, 2)
AND ct.unit_class != 0;

UPDATE creature_template AS ct
INNER JOIN creature AS c 
ON ct.entry = c.id
SET ct.dmg_multiplier = 4.6 
WHERE ct.entry = c.id 
AND c.map in (0, 1, 571, 530)
AND ct.minlevel >= 60
AND ct.rank IN (1, 2)
AND ct.unit_class != 0;

UPDATE creature_template AS ct
INNER JOIN creature AS c 
ON ct.entry = c.id
SET ct.dmg_multiplier = 1.7 
WHERE ct.entry = c.id 
AND c.map in (33, 34, 36, 43, 47, 48, 90, 129, 389)
